import React, { useState } from 'react'

function HookUseEffectExample() {

    const [count, incrementCount] = useState(0)
    return (
        <button onClick={() => { incrementCount(count + 1) }}> clicked {count} times</button>
    )
}

export default HookUseEffectExample;
